import React from 'react';
import { Card, CardBody, CardTitle, CardText, Row, Col } from 'react-bootstrap';

function PatientDetailsComponent() {
  return (
    <Card>
      <CardBody>
        <CardTitle className="mb-3">{patientData.patientName}</CardTitle>
        <Row>
          <Col xs={4}>
            <CardText>ID: {patientData.ID}</CardText>
            <CardText>Doctor: {patientData.DoctorName}</CardText>
            <CardText>Gender: {patientData.patientGender}</CardText>
            <CardText>COVID Status: {patientData.patientCovidStatus ? 'Positive' : 'Negative'}</CardText>
            <CardText>Date of Birth: {patientData.patientDOB}</CardText>
            <CardText>Marital Status: {patientData.patientMaritalS}</CardText>
          </Col>
          <Col xs={4}>
            <CardText>Address: {patientData.patientAddress}</CardText>
            <CardText>Phone Number: {patientData.patientphNumber}</CardText>
            <CardText>Email: {patientData.patientEmail}</CardText>
            <CardText>Medical History: {patientData.patientMedicalHistory}</CardText>
            <CardText>Blood Type: {patientData.patientBloodType}</CardText>
          </Col>
          <Col xs={4}>
            <CardText>Current Symptoms: {patientData.patientCurrentSymptoms}</CardText>
            <CardText>Health Insurance Number: {patientData.patientHealthInsurancenumber}</CardText>
            <CardText>Emergency Contact: {patientData.patientEmergencyContact}</CardText>
            <CardText>Admission Date: {patientData.patientAdmissionDate}</CardText>
          </Col>
        </Row>
      </CardBody>
    </Card>
  );
}

export default PatientDetailsComponent;
